// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EthTimeCapsule {
    struct Capsule {
        uint256 amount;
        uint256 unlockTime;
        bool isUnlocked;
    }

    mapping(address => Capsule[]) private capsules;

    event CapsuleCreated(address indexed user, uint256 amount, uint256 unlockTime);
    event CapsuleUnlocked(address indexed user, uint256 amount);

    // Function to create an ETH time capsule
    function createCapsule(uint256 _unlockTime) external payable {
        require(msg.value > 0, "Must send ETH to create a capsule");
        require(_unlockTime > block.timestamp, "Unlock time must be in the future");

        capsules[msg.sender].push(Capsule({
            amount: msg.value,
            unlockTime: _unlockTime,
            isUnlocked: false
        }));

        emit CapsuleCreated(msg.sender, msg.value, _unlockTime);
    }

    // Function to unlock an ETH time capsule
    function unlockCapsule(uint256 _index) external {
        require(_index < capsules[msg.sender].length, "Invalid capsule index");
        Capsule storage capsule = capsules[msg.sender][_index];
        require(!capsule.isUnlocked, "Capsule is already unlocked");
        require(block.timestamp >= capsule.unlockTime, "Capsule is still locked");

        capsule.isUnlocked = true;
        payable(msg.sender).transfer(capsule.amount);
        emit CapsuleUnlocked(msg.sender, capsule.amount);
    }

    // Function to retrieve information about a specific capsule
    function getCapsule(uint256 _index) external view returns (uint256, uint256, bool) {
        require(_index < capsules[msg.sender].length, "Invalid capsule index");
        Capsule memory capsule = capsules[msg.sender][_index];
        return (capsule.amount, capsule.unlockTime, capsule.isUnlocked);
    }

    // Function to retrieve all capsules for a specific user
    function getCapsules() external view returns (Capsule[] memory) {
        return capsules[msg.sender];
    }
}
